import { Call, Email, LocationOn } from "@mui/icons-material";
import { Avatar, Button, Container, Divider, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const Contact = () => {
  return (
    <div>
      <Container>
        <Box display="flex" flexDirection={"column"} width="75%">
          <Box
            paddingY={2}
            display="flex"
            flexDirection={"row"}
            justifyContent="space-between"
            alignItems={"center"}
          >
            <Avatar
              variant="circular"
              sx={{
                backgroundColor: "#18113C",
                width: 48,
                height: 48,
              }}
            >
              <Email fontSize="14" />
            </Avatar>
            <Typography>Email value here...</Typography>
            <Button variant="contained">Update</Button>
          </Box>
          <Divider />
          <Box
            paddingY={2}
            display="flex"
            flexDirection={"row"}
            justifyContent="space-between"
            alignItems={"center"}
          >
            <Avatar
              variant="circular"
              sx={{
                backgroundColor: "#18113C",
                width: 48,
                height: 48,
              }}
            >
              <Call fontSize="14" />
            </Avatar>
            <Typography>Phone number value here...</Typography>
            <Button variant="contained">Update</Button>
          </Box>
          <Divider />
          <Box
            paddingY={2}
            display="flex"
            flexDirection={"row"}
            justifyContent="space-between"
            alignItems={"center"}
          >
            <Avatar
              variant="circular"
              sx={{
                backgroundColor: "#18113C",
                width: 48,
                height: 48,
              }}
            >
              <LocationOn fontSize="14" />
            </Avatar>
            <Typography>Address value here...</Typography>
            <Button variant="contained">Update</Button>
          </Box>
        </Box>
      </Container>
    </div>
  );
};

export default Contact;
